import React, { useState, useEffect } from 'react';
import ForceGraph2D from 'react-force-graph-2d';

const yearOptions = [
  { value: 0, label: "2003–2004" },
  { value: 1, label: "2005–2006" },
  { value: 2, label: "2007–2008" },
  { value: 3, label: "2009–2010" },
  { value: 4, label: "2011–2012" },
  { value: 5, label: "2013–2014" }
];

const ageOptions = Array.from({ length: 8 }, (_, i) => i); // 0–7
const genderOptions = ["Male", "Female"];
const reteOptions = ["BONF", "FDR"];

const letterColorMap = {
  A: "#1f77b4", B: "#ff7f0e", C: "#2ca02c", D: "#d62728",
  E: "#9467bd", F: "#8c564b", G: "#e377c2", H: "#7f7f7f",
  I: "#bcbd22", J: "#17becf", K: "#ff1493", L: "#00ced1",
  M: "#9acd32", N: "#4682b4"
};

function App() {
  const [graphData, setGraphData] = useState({ nodes: [], edges: [] });

  const [tipoRete, setTipoRete] = useState("BONF");
  const [eta, setEta] = useState(0);
  const [rangeAnni, setRangeAnni] = useState(0);
  const [sesso, setSesso] = useState("Male");

  useEffect(() => {
    fetch(`/graph?tipo_rete=${tipoRete}&eta=${eta}&anno=${rangeAnni}&sesso=${sesso}`)
      .then(res => res.json())
      .then(data => setGraphData({ nodes: data.nodes, links: data.edges }))
      .catch(err => console.error("Errore nel caricamento del grafo:", err));
  }, [tipoRete, eta, rangeAnni, sesso]);

  return (
    <div>
      <h2>Visualizzazione Grafo ICD</h2>
      <div style={{ marginBottom: "15px" }}>
        <label>
          Tipo rete:
          <select value={tipoRete} onChange={(e) => setTipoRete(e.target.value)}>
            {reteOptions.map(opt => (
              <option key={opt} value={opt}>{opt}</option>
            ))}
          </select>
        </label>

        <label style={{ marginLeft: "10px" }}>
          Età:
          <select value={eta} onChange={(e) => setEta(Number(e.target.value))}>
            {ageOptions.map(i => (
              <option key={i} value={i}>{i}</option>
            ))}
          </select>
        </label>

        <label style={{ marginLeft: "10px" }}>
          Range anni:
          <select value={rangeAnni} onChange={(e) => setRangeAnni(Number(e.target.value))}>
            {yearOptions.map(opt => (
              <option key={opt.value} value={opt.value}>{opt.label}</option>
            ))}
          </select>
        </label>

        <label style={{ marginLeft: "10px" }}>
          Sesso:
          <select value={sesso} onChange={(e) => setSesso(e.target.value)}>
            {genderOptions.map(opt => (
              <option key={opt} value={opt}>{opt}</option>
            ))}
          </select>
        </label>
      </div>

      <ForceGraph2D
        graphData={graphData}
        nodeAutoColorBy="id"
        nodeCanvasObject={(node, ctx, globalScale) => {
          const label = node.id;
          const fontSize = 12 / globalScale;
          const color = letterColorMap[label[0]] || "#ccc";

          ctx.beginPath();
          ctx.arc(node.x, node.y, 5, 0, 2 * Math.PI, false);
          ctx.fillStyle = color;
          ctx.fill();

          ctx.font = `${fontSize}px Sans-Serif`;
          ctx.textAlign = "center";
          ctx.textBaseline = "top";
          ctx.fillStyle = "#000";
          ctx.fillText(label, node.x, node.y + 6);
        }}
      />
    </div>
  );
}

export default App;
